INSERT INTO `service1` VALUES (2,'2015-08-10 09:28:59','2016-04-02 10:06:57','Health Care',NULL,'1','1',NULL,NULL,'/images/ico/mapicon/srv_health_care.jpg',22,1,0,0,'',NULL,NULL),(3,'2015-08-10 09:28:59','2016-03-17 15:26:35','Doctor','Got a medical emergency in the middle of night? No worries, get the highly professional doctor at your doorstep.','1','158ff822-3af6-4b60-95a9-202c7e73eaae','doctorOrder','  <img  src=\"nbdimages/images/img-1.jpg\" alt=\"doctor image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We guarantee Best Doctors and Specialists at your location</h3><p class = \"textContentId1\"> No more waiting for long hours in Clinics  </p><p class = \"textContentId2\">   No more wasting time in Traffic </p>                 <p class = \"textContentId3\">  No more ignoring of your health for time, company confusion. </p>','/images/ico/mapicon/srv_doctor.jpg',29,0,0,1,'',NULL,'nbdimages/serviceicons/ico_doctor.png'),(4,'2015-08-10 09:28:59','2016-03-17 15:26:35','Electrician','Worried about wiring or need to install a geyser. Our well trained electricians will fix’em up within no time.','2','1b867019-e781-4726-930d-e3a44dbb6fac','pathologyOrder','  <img  src=\"nbdimages/images/electrician-1.jpg\" alt=\"electrician image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Is Electricity issue? Non functioning gadgets? Do not worry about it. We are here to fix these issues.</h3><p class = \"textContentId1\"> 100% Safety Guaranteed, Free Service if the problem recurs  </p><p class = \"textContentId2\">   Qualified & Trained Engineers </p>                 <p class = \"textContentId3\">  Trained staff in repairing household electrical points, fans, lights, wiring problem, short circuit issues etc. </p> <p class = \"textContentId4\">  Specialized engineers in branded & local large appliances like Geysers, Air Conditioners, Television, Refrigerators, Washing Machines </p>','/images/ico/mapicon/srv_electrician.jpg',12,0,0,1,'',NULL,'nbdimages/serviceicons/ico_electrician.png'),(5,'2015-08-10 09:28:59','2016-04-02 10:06:57','Up Keeping',NULL,'2','2',NULL,NULL,'/images/ico/mapicon/srv_up_keeping.jpg',10,1,0,0,'',NULL,NULL),(6,'2015-08-10 09:28:59','2016-03-17 15:26:35','PhysioTherapy','Be it a Sports injury or a lingering back pain, the treatment is possible in the comfort of your home.','1','21db609d-8a05-4a05-9f6d-4ef37e875ea8','pathologyOrder',' <img  src=\"nbdimages/images/physiotheraphy.png\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Injury? Pain? Arthritis? Surgery? and still being asked to travel to your physiotherapist.</h3><p class = \"textContentId1\"> Auro brings physiotherapy services at your doorstep  </p><p class = \"textContentId2\">   All physiotherapists use latest techniques and devices </p>                 <p class = \"textContentId3\">  100% certified with a masters degree in physiotherapy </p> <p class = \"textContentId4\">  Average experience more than 5 years </p>','/images/ico/mapicon/srv_physiotherapy.jpg',23,0,0,1,'',NULL,'nbdimages/serviceicons/ico_physiotheraphy.png'),(7,'2015-08-10 09:28:59','2016-03-17 15:26:35','Home Care Taker','Worried about your home in your absence? We have the best Care takers on whom you can trust on.','1','29d5b0e3-b3b0-4e43-8840-808750518242','pathologyOrder','<img  src=\"nbdimages/images/homecare-1.jpg\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Nursing is not just about health care, it is about caring. A little compassion, care helps healing. Auro brings to you the best nursing at home.</h3><p class = \"textContentId1\"> Fully certified senior nurse & home care services.  </p><p class = \"textContentId2\">   Qualified nurses in handling post surgery care, oxygen administration, injection, tracheostomy, wound care, suture removal, infusions etc. </p>                 <p class = \"textContentId3\">  Hourly/daily/weekly/monthly packa